import React from 'react';
import CardGrid from '../components/CardGrid.js';

const Portfolio = () => {
    return (
        <div className="title-container">
            <div className="marquee">
                <h1>Portfolio</h1>
            </div>
            <div className="marquee">
                <p>Explore my portfolio.</p>
            </div>
            <CardGrid />
        </div>
    );
};

export default Portfolio;
